@EnciclopediaMedica

Se o seu olho fica assim depois de um dia de trabalho na tela do monitor, é provável que você tenha a síndrome do olho seco. 
A SÍNDROME DO OLHO SECO é uma alteração que ocorre na usuperfície da córnea e da conjuntiva devido à ausência ou baixa qualidade do líquido lacrimal. Como resultado, a superfície do olho fica mal hidratada, o que pode causar desconforto, problemas de visão e lesões na córnea e na conjuntiva.
As consequências desta condição são muito graves: cicatrizes, úlceras na córnea, cegueira.

@ENCICLOPEDIAMEDICA

