UMA RARA MUTAÇÃO GENÉTICA que explica os fios grisalhos na cabeça da menina e de sua mãe que é transmitida nesta família pela linhagem feminina. Essa característica é causada pela POLIOSE - FALTA DE PIGMENTO NA PELE E NOS CABELOS.

Quando criança, a mãe da menina se preocupava com sua aparência, mas agora ela fica feliz por não ser como todo mundo. 
“Na escola, as crianças tentavam me intimidar e me davam vários apelidos ofensivos, como gambá, por exemplo”, lembra. Quando ela estava grávida, ela realmente esperava que sua filha também tivesse uma característica tão única.

@ENCICLOPEDIAMEDICA

@DERRUBANDOASPEDRASGUIASDAGEORGIA

A SÍNDROME DO CABELO DESPENTEADO É UMA RARA ANOMALIA GENÉTICA que se manifesta por uma alteração no formato da mecha do cabelo na cabeça e, como resultado, causa a incapacidade de pentear e modelar o cabelo saliente. Geralmente aparece entre as idades de 3 meses e 12 anos.

@ENCICLOPEDIAMEDICA

