SÍNDROME DE EHLERS DANLOS.

Esta doença está associada a uma violação do desenvolvimento das estruturas de colágeno, pelo que os pacientes apresentam hipermobilidade articular, hiperelasticidade da pele e fragilidade tecidual pronunciada.

